import React, { Component } from 'react'
import { Menu } from 'antd';
import { AppstoreOutlined, MailOutlined, SettingOutlined } from '@ant-design/icons';
import './MenuSilder.scss'
import 'antd/dist/antd.css';
const { SubMenu } = Menu;
export default class MenuSilder extends Component {
    handleClick = e => {
        console.log('click ', e);
      };

    render() {
        return (
            
               <Menu
        onClick={this.handleClick}
        id='LeftMenu'
        defaultSelectedKeys={['1']}
        defaultOpenKeys={['sub1']}
        mode="inline"
      >
        <SubMenu className='dor_one' key="sub1" icon={<MailOutlined />} title="Domitory 1">
          <Menu.ItemGroup key="g1" >
            <Menu.Item key="1">Option 1</Menu.Item>
            <Menu.Item key="2">Option 2</Menu.Item>
          </Menu.ItemGroup>          
        </SubMenu>
        <SubMenu key="sub2" icon={<AppstoreOutlined />} title="Domitory 2">
          <Menu.Item key="5">Option 5</Menu.Item>
          <Menu.Item key="6">Option 6</Menu.Item>          
        </SubMenu>
        <SubMenu key="sub4" icon={<SettingOutlined />} title="Domitory 2">
          <Menu.Item key="9">Option 9</Menu.Item>
          <Menu.Item key="10">Option 10</Menu.Item>
          <Menu.Item key="11">Option 11</Menu.Item>
          <Menu.Item key="12">Option 12</Menu.Item>
        </SubMenu>
      </Menu>
           
        )
    }
}
